import{_ as v}from"./plugin-vue_export-helper-DlAUqK2U.js";import{r as E,o as I,c as C,d as A,e as V,a as z,f as u}from"./app-CjoW4Pl-.js";const l={},Q=u(`<p><strong>注</strong>：在linux中，大部分指令执行后没有输出信息则代表成功（<code>ip addr</code>之类的指令除外）</p><h2 id="关机前保存" tabindex="-1"><a class="header-anchor" href="#关机前保存"><span>关机前保存</span></a></h2><p>关机和重启之前，建议使用以下命令将数据保存到硬盘</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">sync</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>关机</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">shutdown</span> <span class="token parameter variable">-h</span> now
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>重启</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">shutdown</span> <span class="token parameter variable">-r</span> now
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">reboot</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><h2 id="目录及文件操作" tabindex="-1"><a class="header-anchor" href="#目录及文件操作"><span>目录及文件操作</span></a></h2><p>目录和文件都算是文件</p><h3 id="切换目录" tabindex="-1"><a class="header-anchor" href="#切换目录"><span>切换目录</span></a></h3><p>切换目录命令</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token builtin class-name">cd</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>返回上一级目录</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token builtin class-name">cd</span> <span class="token punctuation">..</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>返回当前用户目录</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token builtin class-name">cd</span> ~
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>返回根目录</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token builtin class-name">cd</span> /
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>绝对路径和相对路径</p><p>绝对路径以 <code>/</code> 开头</p><p>相对路径以 <code>../</code> 或 <code>./</code> 开头</p><p>显示当前目录</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token builtin class-name">pwd</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><h3 id="列出目录" tabindex="-1"><a class="header-anchor" href="#列出目录"><span>列出目录</span></a></h3><p>列出当前文件夹下的文件</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">ls</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>-a参数 查看所有文件，包括隐藏文件</p><p>-l参数 列出所有文件，包括文件的属性和权限，不包含隐藏文件</p><p>参数可以组合使用</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">ls</span> <span class="token parameter variable">-al</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><h3 id="创建和删除目录" tabindex="-1"><a class="header-anchor" href="#创建和删除目录"><span>创建和删除目录</span></a></h3><h4 id="创建文件夹" tabindex="-1"><a class="header-anchor" href="#创建文件夹"><span>创建文件夹</span></a></h4><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">mkdir</span> 文件夹名
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>也可以一次建多层文件夹</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">mkdir</span> <span class="token parameter variable">-p</span> 文件夹1/文件夹2/文件夹3
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>参数</p><p>-m ：配置文件的权限喔！直接配置，不需要看默认权限 (umask) 的脸色～</p><p>-p ：帮助你直接将所需要的目录(包含上一级目录)递归创建起来！</p><h4 id="删除文件夹" tabindex="-1"><a class="header-anchor" href="#删除文件夹"><span>删除文件夹</span></a></h4><p><strong>注意</strong>：无法删除一个不为空的文件夹</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">rmdir</span> 文件夹名
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><h3 id="拷贝文件至某目录" tabindex="-1"><a class="header-anchor" href="#拷贝文件至某目录"><span>拷贝文件至某目录</span></a></h3><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">cp</span> 文件名 目标文件夹名
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>参数</p><p>-a：相当于 -pdr 的意思，至于 pdr 请参考下列说明；(常用)</p><p>-p：连同文件的属性一起复制过去，而非使用默认属性(备份常用)；</p><p>-d：若来源档为连结档的属性(link file)，则复制连结档属性而非文件本身；</p><p>-r：递归持续复制，用於目录的复制行为；(常用)</p><p>-f：为强制(force)的意思，若目标文件已经存在且无法开启，则移除后再尝试一次；</p><p>-i：若目标档(destination)已经存在时，在覆盖时会先询问动作的进行(常用)</p><p>-l：进行硬式连结(hard link)的连结档创建，而非复制文件本身。</p><p>-s：复制成为符号连结档 (symbolic link)，亦即『捷径』文件；</p><p>-u：若 destination 比 source 旧才升级 destination ！</p><h3 id="移除文件或目录" tabindex="-1"><a class="header-anchor" href="#移除文件或目录"><span>移除文件或目录</span></a></h3><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">rm</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>参数</p><p>-f 忽略不存在的文件，不会出现警告，强制删除</p><p>-r 递归删除目录</p><p>-i 互动，删除前询问是否删除</p><blockquote><p>#删除系统中所有的文件，删库跑路就是这么操作的！</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">rm</span> <span class="token parameter variable">-rf</span> /
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div></blockquote><h3 id="移动文件或目录" tabindex="-1"><a class="header-anchor" href="#移动文件或目录"><span>移动文件或目录</span></a></h3><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">mv</span> 文件或文件夹 目标位置
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>参数</p><p>-f 强制移动</p><p>-u 只替换更新过的文件</p><h3 id="看懂文件属性" tabindex="-1"><a class="header-anchor" href="#看懂文件属性"><span>看懂文件属性</span></a></h3><p>Linux系统是一种典型的多用户系统，不同的用户处于不同的地位，拥有不同的权限。为了保护系统的安全性，Linux系统对不同的用户访问同一文件（包括目录文件）的权限做了不同的规定。</p><p>在Linux中我们可以使用 <code>ll</code> 或者 <code>ls –l</code> 命令来显示一个文件的属性以及文件所属的用户和组，如：</p><img src="data:image/png;base64,"><p>实例中，boot文件的第一个属性用<code>d</code>表示。<code>d</code>在Linux中代表该文件是一个目录文件。</p><p>在Linux中第一个字符代表这个文件是目录、文件或链接文件等等：</p><ul><li>当为[ d ]则是目录</li><li>当为[ - ]则是文件；</li><li>若是[ l ]则表示为链接文档 ( link file )；</li><li>若是[ b ]则表示为装置文件里面的可供储存的接口设备 ( 可随机存取装置 )；</li><li>若是[ c ]则表示为装置文件里面的串行端口设备，例如键盘、鼠标 ( 一次性读取装置 )。</li></ul><p>接下来的字符中，以三个为一组，且均为『rwx』 的三个参数的组合。</p><p>其中，[ r ]代表可读(read)、[ w ]代表可写(write)、[ x ]代表可执行(execute)。</p><p>要注意的是，这三个权限的位置不会改变，如果没有权限，就会出现减号[ - ]而已。</p><p>每个文件的属性由左边第一部分的10个字符来确定（如下图）：</p><img src="data:image/png;base64,"><p>从左至右用0-9这些数字来表示。</p><p>第0位确定文件类型，第1-3位确定属主（该文件的所有者）拥有该文件的权限。第4-6位确定属组（所有者的同组用户）拥有该文件的权限，第7-9位确定其他用户拥有该文件的权限。</p><p>其中：</p><p>第1、4、7位表示读权限，如果用<code>r</code>字符表示，则有读权限，如果用<code>-</code>字符表示，则没有读权限；</p><p>第2、5、8位表示写权限，如果用<code>w</code>字符表示，则有写权限，如果用<code>-</code>字符表示没有写权限；</p><p>第3、6、9位表示可执行权限，如果用&quot;x&quot;字符表示，则有执行权限，如果用&quot;-&quot;字符表示，则没有执行权限。</p><p>对于文件来说，它都有一个特定的所有者，也就是对该文件具有所有权的用户。</p><p>同时，在Linux系统中，用户是按组分类的，一个用户属于一个或多个组。</p><p>文件所有者以外的用户又可以分为文件所有者的同组用户和其他用户。</p><p>因此，Linux系统按文件所有者、文件所有者同组用户和其他用户来规定了不同的文件访问权限。</p><p>在以上实例中，boot 文件是一个目录文件，属主和属组都为 root。</p><h3 id="修改文件属性" tabindex="-1"><a class="header-anchor" href="#修改文件属性"><span>修改文件属性</span></a></h3><ol><li>chgrp：更改文件属组</li></ol><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">chgrp</span> <span class="token punctuation">[</span>-R<span class="token punctuation">]</span> 属组名 文件名
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>-R：递归更改文件属组，就是在更改某个目录文件的属组时，如果加上-R的参数，那么该目录下的所有文件的属组都会更改。</p><ol start="2"><li>chown：更改文件属主，也可以同时更改文件属组</li></ol><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">chown</span> <span class="token punctuation">[</span>–R<span class="token punctuation">]</span> 属主名 文件名

<span class="token function">chown</span> <span class="token punctuation">[</span>-R<span class="token punctuation">]</span> 属主名：属组名 文件名
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><ol start="3"><li>chmod：更改文件9个属性</li></ol><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">chmod</span> <span class="token punctuation">[</span>-R<span class="token punctuation">]</span> xyz 文件或目录
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>Linux文件属性有两种设置方法，一种是数字，一种是符号。</p><p>Linux文件的基本权限就有九个，分别是<code>owner/group/others</code>三种身份各有自己的<code>read/write/execute</code>权限。</p><p>先复习一下刚刚上面提到的数据：文件的权限字符为：『-rwxrwxrwx』， 这九个权限是三个三个一组的！其中，我们可以使用数字来代表各个权限，各权限的分数对照表如下：</p><p><code> r:4 w:2 x:1</code></p><p>每种身份(owner/group/others)各自的三个权限(r/w/x)分数是需要累加的，例如当权限为：[-rwxrwx---] 分数则是：</p><div class="language-text line-numbers-mode" data-ext="text" data-title="text"><pre class="language-text"><code>owner = rwx = 4+2+1 = 7

group = rwx = 4+2+1 = 7

others= --- = 0+0+0 = 0
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">chmod</span> <span class="token number">777</span> filename
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><h3 id="文件内容查看" tabindex="-1"><a class="header-anchor" href="#文件内容查看"><span>文件内容查看</span></a></h3><p>Linux系统中使用以下命令来查看文件的内容：</p><ul><li><p><code>cat</code> 由第一行开始显示文件内容</p></li><li><p><code>tac</code> 从最后一行开始显示，可以看出 <code>tac</code> 是 <code>cat</code> 的倒着写！</p></li><li><p><code>nl</code> 显示的时候，顺道输出行号！</p></li><li><p><code>more</code> 一页一页的显示文件内容</p></li><li><p><code>less</code> 与 <code>more</code> 类似，但是比 <code>more</code> 更好的是，他可以往前翻页！</p></li><li><p><code>head</code> 只看头几行</p></li><li><p><code>tail</code> 只看尾巴几行</p></li></ul><p>你可以使用 man [命令]来查看各个命令的使用文档，如 ：<code>man cp</code>。</p><h4 id="cat" tabindex="-1"><a class="header-anchor" href="#cat"><span>cat</span></a></h4><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">cat</span> <span class="token punctuation">[</span>-AbEnTv<span class="token punctuation">]</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>选项与参数：</p><p>-A ：相当于 -vET 的整合选项，可列出一些特殊字符而不是空白而已；</p><p>-b ：列出行号，仅针对非空白行做行号显示，空白行不标行号！</p><p>-E ：将结尾的断行字节 $ 显示出来；</p><p>-n ：列印出行号，连同空白行也会有行号，与 -b 的选项不同；</p><p>-T ：将 [tab] 按键以 ^I 显示出来；</p><p>-v ：列出一些看不出来的特殊字符</p><h4 id="tac" tabindex="-1"><a class="header-anchor" href="#tac"><span>tac</span></a></h4><p>tac与cat命令刚好相反，文件内容从最后一行开始显示</p><h4 id="nl" tabindex="-1"><a class="header-anchor" href="#nl"><span>nl</span></a></h4><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">nl</span> <span class="token punctuation">[</span>-bnw<span class="token punctuation">]</span> 文件
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>选项与参数：</p><p>-b ：指定行号指定的方式，主要有两种：-b a ：表示不论是否为空行，也同样列出行号(类似 cat -n)；-b t ：如果有空行，空的那一行不要列出行号(默认值)；</p><p>-n ：列出行号表示的方法，主要有三种：-n ln ：行号在荧幕的最左方显示；-n rn ：行号在自己栏位的最右方显示，且不加 0 ；-n rz ：行号在自己栏位的最右方显示，且加 0 ；</p><p>-w ：行号栏位的占用的位数。</p><h4 id="more" tabindex="-1"><a class="header-anchor" href="#more"><span>more</span></a></h4><p>在 more 这个程序的运行过程中，有几个按键可以按的：</p><p>空白键 (space)：代表向下翻一页；</p><p>Enter 代表向下翻『一行』；</p><p>/字串 代表在这个显示的内容当中，向下搜寻『字串』这个关键字；</p><p>:f 立刻显示出档名以及目前显示的行数；</p><p>q 代表立刻离开 more ，不再显示该文件内容。</p><p>b 或 <code>ctrl + b</code> 代表往回翻页，不过这动作只对文件有用，对管线无用。</p><h4 id="less" tabindex="-1"><a class="header-anchor" href="#less"><span>less</span></a></h4><p>less运行时可以输入的命令有：</p><p>空白键 向下翻动一页；</p><p>pagedown 向下翻动一页；</p><p>pageup 向上翻动一页；</p><p><code>/字串</code> 向下搜寻<code>字串</code>的功能；</p><p><code>?字串</code> 向上搜寻<code>字串</code>的功能；</p><p>n 重复前一个搜寻 (与 / 或 ? 有关！)</p><p>N 反向的重复前一个搜寻 (与 / 或 ? 有关！)</p><p>q 离开 less 这个程序</p><h4 id="head" tabindex="-1"><a class="header-anchor" href="#head"><span>head</span></a></h4><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">head</span> <span class="token punctuation">[</span>-n number<span class="token punctuation">]</span> 文件
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>选项与参数：</p><p>-n 后面接数字，代表显示几行的意思！</p><h4 id="tail" tabindex="-1"><a class="header-anchor" href="#tail"><span>tail</span></a></h4><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code><span class="token function">tail</span> <span class="token punctuation">[</span>-n number<span class="token punctuation">]</span> 文件
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>选项与参数：</p><p>-n ：后面接数字，代表显示几行的意思</p><h3 id="软链接和硬链接" tabindex="-1"><a class="header-anchor" href="#软链接和硬链接"><span>软链接和硬链接</span></a></h3><p>Linux 链接分两种，一种被称为硬链接（Hard Link），另一种被称为符号链接（Symbolic Link）。</p><p>一般情况下，ln 命令产生硬链接。</p><h4 id="硬连接" tabindex="-1"><a class="header-anchor" href="#硬连接"><span>硬连接</span></a></h4><p>硬连接指通过索引节点来进行连接。在 Linux 的文件系统中，保存在磁盘分区中的文件不管是什么类型都给它分配一个编号，称为索引节点号(Inode Index)。在 Linux 中，多个文件名指向同一索引节点是存在的。比如：A 是 B 的硬链接（A 和 B 都是文件名），则 A 的目录项中的 inode 节点号与 B 的目录项中的 inode 节点号相同，即一个 inode 节点对应两个不同的文件名，两个文件名指向同一个文件，A 和 B 对文件系统来说是完全平等的。删除其中任何一个都不会影响另外一个的访问。</p><p>硬连接的作用是允许一个文件拥有多个有效路径名，这样用户就可以建立硬连接到重要文件，以防止“误删”的功能。其原因如上所述，因为对应该目录的索引节点有一个以上的连接。只删除一个连接并不影响索引节点本身和其它的连接，只有当最后一个连接被删除后，文件的数据块及目录的连接才会被释放。也就是说，文件真正删除的条件是与之相关的所有硬连接文件均被删除。</p><h4 id="软连接" tabindex="-1"><a class="header-anchor" href="#软连接"><span>软连接</span></a></h4><p>另外一种连接称之为符号连接（Symbolic Link），也叫软连接。软链接文件有类似于 Windows 的快捷方式。它实际上是一个特殊的文件。在符号连接中，文件实际上是一个文本文件，其中包含的有另一文件的位置信息。比如：A 是 B 的软链接（A 和 B 都是文件名），A 的目录项中的 inode 节点号与 B 的目录项中的 inode 节点号不相同，A 和 B 指向的是两个不同的 inode，继而指向两块不同的数据块。但是 A 的数据块中存放的只是 B 的路径名（可以根据这个找到 B 的目录项）。A 和 B 之间是“主从”关系，如果 B 被删除了，A 仍然存在（因为两个是不同的文件），但指向的是一个无效的链接。</p><h2 id="vim编辑器" tabindex="-1"><a class="header-anchor" href="#vim编辑器"><span>vim编辑器</span></a></h2>`,161),d={href:"https://www.vim.org/",target:"_blank",rel:"noopener noreferrer"},r=u(`<p>下载命令</p><div class="language-bash line-numbers-mode" data-ext="sh" data-title="sh"><pre class="language-bash"><code>yum <span class="token parameter variable">-y</span> <span class="token function">install</span> vim*
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>相关文章：</p>`,3),g={href:"https://mp.weixin.qq.com/s?__biz=Mzg2NTAzMTExNg==&mid=2247483895&idx=1&sn=b685934ee0d08b9d01cc0c35ed7fed71",target:"_blank",rel:"noopener noreferrer"},a=A("img",{src:"data:image/png;base64,"},null,-1),n=A("h2",{id:"用户管理及系统管理",tabindex:"-1"},[A("a",{class:"header-anchor",href:"#用户管理及系统管理"},[A("span",null,"用户管理及系统管理")])],-1),M=A("p",null,"相关文章：",-1),e={href:"https://mp.weixin.qq.com/s?__biz=Mzg2NTAzMTExNg==&mid=2247483895&idx=1&sn=b685934ee0d08b9d01cc0c35ed7fed71",target:"_blank",rel:"noopener noreferrer"};function m(c,f){const q=E("ExternalLinkIcon");return I(),C("div",null,[Q,A("p",null,[V("官网："),A("a",d,[V("https://www.vim.org/"),z(q)])]),r,A("ul",null,[A("li",null,[A("a",g,[V("https://mp.weixin.qq.com/s?__biz=Mzg2NTAzMTExNg==&mid=2247483895&idx=1&sn=b685934ee0d08b9d01cc0c35ed7fed71"),z(q)])])]),a,n,M,A("ul",null,[A("li",null,[A("a",e,[V("https://mp.weixin.qq.com/s?__biz=Mzg2NTAzMTExNg==&mid=2247483895&idx=1&sn=b685934ee0d08b9d01cc0c35ed7fed71"),z(q)])])])])}const U=v(l,[["render",m],["__file","基本命令.html.vue"]]);export{U as default};
